import React from "react";
import { useNavigate } from "react-router-dom";

const MultiChannelView = ({ files }) => {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col items-center p-6">
      <h2 className="text-2xl font-bold mb-4">Uploaded Datasets</h2>
      <table className="w-full max-w-md border-collapse border border-gray-300 bg-white">
        <thead>
          <tr className="bg-gray-200">
            <th className="border border-gray-300 p-2">File Name</th>
            <th className="border border-gray-300 p-2">Size</th>
            <th className="border border-gray-300 p-2">Date</th>
            <th className="border border-gray-300 p-2">Action</th>
          </tr>
        </thead>
        <tbody>
          {files.map((file, index) => (
            <tr key={index} className="text-center">
              <td className="border border-gray-300 p-2">{file.name}</td>
              <td className="border border-gray-300 p-2">{file.size}</td>
              <td className="border border-gray-300 p-2">{file.date}</td>
              <td className="border border-gray-300 p-2">
                <button
                  className="bg-blue-500 text-white p-2 rounded"
                  onClick={() => navigate(`/dataset/${file.name}`)}
                >
                  View
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default MultiChannelView;
